import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import { Link } from 'react-router-dom';
import pathwaysData from './pathwaysData'; // Make sure to import your data

function Header() {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <div>
      <Button
        color="inherit"
        aria-controls="pathway-menu"
        aria-haspopup="true"
        onClick={handleClick}
      >
        Explore Pathways
      </Button>
      <Menu
        id="pathway-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        {pathwaysData.techPaths.map((pathway, index) => (
          <MenuItem
            key={index}
            component={Link}
            to={`/techpaths/${index}`}
            onClick={handleClose} // Close the menu when an item is clicked
          >
            {pathway.title}
          </MenuItem>
        ))}
      </Menu>
    </div>
  );
}

export default Header;
